import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import './App.css';
import UserRegistration from './components/Registration&Authentication/UserRegistration';
import HomePage from './components/main page/HomePage';
import AccountPage from './components/account/AccountPage';
import LoginPage from './components/Registration&Authentication/LoginPage';
import CreateWorkoutsForm from './components/workouts/CreateWorkoutsForm';
import UserWorkouts from './components/workouts/UserWorkouts';
import SubscriptionPage from './components/subscriptions/SubscriptionPage';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  return (
    <div className='App'>
       <Router>
      <Routes>
        <Route
          path="/"
          element={<Navigate to="/home" />}
        />
        <Route path="/home" element={<HomePage isAuthenticated={isAuthenticated} />} />
        <Route path="/account" element={<AccountPage />} />
        <Route path='/create-workout' element={<CreateWorkoutsForm/>}></Route>
        <Route path='/my-workouts' element={<UserWorkouts/>}></Route>
        <Route path='/register' element={<UserRegistration/>}></Route>
        <Route
          path='/login'
          element={<LoginPage />}
        />
        <Route path='/plans' element={<SubscriptionPage/>}></Route>
      </Routes>
    </Router>

    </div>

  );
}

export default App;
